def extract_value_from_table(table, row_name, column_name):
    row_index = None
    column_index = None
    for i in range(len(table)):
        if table[i][0] == row_name:
            row_index = i
            break
    if row_index is None:
        return None
    for j in range(len(table[0])):
        if table[0][j] == column_name:
            column_index = j
            break
    if column_index is None:
        return None
    value = table[row_index][column_index]
    if value.isdigit():
        return int(value)
    else:
