def calculate_average(table, row_name):
    total = 0
    count = 0
    for i in range(1, len(table[0])):
        value = extract_value_from_table(table, row_name, table[0][i])
        if value is not None:
            total += value
            count += 1
    if count == 0:
        return None
    return total / count / 1000

